import React from 'react';
import Nav from './Nav';
import './CSS/Home.css';
import './CSS/Contact.css';
import Anas from '../img/Anas.jpg';
import Footer from './Footer';

export default class Home extends React.Component{
    render(){
        return(
            <div className="home-container">
                <Nav/>
                <div className="main">
                    <div className="img-cont">
                        <img src={Anas} alt="anas.jpg"></img>
                    </div>
                    <p>Hi folks,</p>
                    <p>Welcome to my page. You are looking at my portfolio.
                    Talking about my self, am a student studying at Techno India University.
                    My Qualifications are basically 10+2 (10<sup>th</sup> pass and 12<sup>th</sup> pass)
                        and I am also mastering web-development, basically I am not studying this as my main goal,
                        this is just as a side skill. My actual goal is to become a Data-Scientist. There were alot of hardships that I had to go through.
                        My one and only MOTO is</p>
                    <strong>LEARN... GROW... EVOLVE...</strong>
                    <p>If you are here to Know more about me and my skills, talents then go right up there and smash that Projects link to get redirected to 
                        my projects. And if you are interested in contacting me then go and smash that Contact link to get my contact info.
                    </p>
                    <div className="contact-box">
                        <button handleClick={this.handleClick} className="cross"><i className="fa fa-times fa-1x"></i></button>
                        <p className="contact">
                            E-mail: anasalam027@gmail.com<br/>
                            Phone Number: +91 70448 04030<br/><hr/>
                        </p>
                        <p>   
                            Social Media Handles:
                        </p>
                        <div className="social">
                            <a href="https://www.instagram.com/aannaassalam/"><i className="fa fa-instagram fa-2x"></i></a>
                            <a href="https://www.facebook.com/anasalam027/"><i className="fa fa-facebook-square fa-2x"></i></a>
                            <a href="https://twitter.com/aannaassalam/"><i className="fa fa-twitter-square fa-2x"></i></a>
                            <a href="https://www.linkedin.com/in/anas-alam-0207331b2/"><i className="fab fa-linkedin fa-2x"></i></a>
                        </div>
                    </div>
                </div>
                <Footer/>
            </div>
        );
    }

    handleClick = () =>{
        var a = document.getElementById("cont");
        a.classList.remove("activated");
        a.classList.add("");
        var contactBox = document.getElementsByClassName("contact-box");
        contactBox[0].style.display = "none";
    }
}
